<script>
    export default {
        name: "detail-mask",
        data(){
          return {

          }
        },
        mounted(){
          document.getElementById('detail').style.width = document.documentElement.clientWidth + 'px';
          document.getElementById('detail').style.height = document.documentElement.clientHeight - 60 + 'px';
          window.onresize = (ev) => {
            document.getElementById('detail').style.width = document.documentElement.clientWidth + 'px';
            document.getElementById('detail').style.height = document.documentElement.clientHeight  - 60 + 'px';
          };

          this.initContentMask();
          this.initListenMsg();
        },
        methods: {
          initContentMask(){
            const phone = document.querySelector('.phone'),
              bar = document.querySelector('.bar'),
              avatar = document.querySelector('.avatar'),
              back = document.querySelector('.circle'),
              menu = document.querySelector('.circle-right');

            phone.addEventListener('scroll', (e) => {
              let offset = phone.scrollTop;

              if (offset > 133) {
                bar.classList.add('show-name');
              } else {
                bar.classList.remove('show-name');
              }

              if (offset > 71) {
                bar.classList.add('sticky');
              } else {
                bar.classList.remove('sticky');
              }
              offset = offset > 60 ? 60:offset;
              const scale = 1 - offset / 60 * .44;
              avatar.style.transform = `scale(${scale})`;
            }, { passive: true });

            back.addEventListener('click', (e) => {
              console.log(e);
              this.$bus.$emit('close_detail_mask','');
            });

            menu.addEventListener('click', (e) => {

            });
          },

          initListenMsg(){
            this.$bus.$on('detail-data-init', (detail_data) => {

            });

            this.$bus.$on('detail-data-update', (detail_data) => {

            });
          }
        }
    }
